    render(){
        return(
            <div>
                <Navbar/>
                <div>
                    <h1>product Details</h1>

                    <Container>
                        <Row>
                            <Col>
                            <h2>img</h2>
                            </Col>
                            <Col><h2>details</h2>
                            </Col>
                        </Row>
                    </Container>
                </div>
                <Footer/>
            </div>
        );
    }
}
export default ProductDetails;
